  <Paper>
    <Tabs value={0} indicatorColor="primary" textColor="primary" centered>
      <Tab
        icon={
          <SvgIcon>
            <path d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8z" />
          </SvgIcon>
        }
      />
      <Tab
        icon={
          <SvgIcon>
            <path d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8z" />
          </SvgIcon>
        }
      />
      <Tab
        icon={
          <SvgIcon>
            <path d="M0 0h24v24H0z" />
          </SvgIcon>
        }
      />
    </Tabs>
  </Paper>
);
